    false,nt"url": null,nt"notes": "This data set represents the state (political)
    boundaries of Mexico. The Digitial Chart of the World data set had incomplete state
    boundaries, which was the reason to create this coverage. It was digitized from
    a 1992 CIA map at a scale of 1:3 million. The coast line came from the Digital Chart
    of the world at a scale of 1:1 million. The state names were labeled from the map
    and an attribute to help fill the states was added. The labeling process was done
    manually.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
